(10, 'Basketball Tryouts', '2015-11-22 08:54:18', '2015-11-23 08:48:21', 'basketball-tryouts', '<p>ERICKA ENTERPRISE<br />It is an open-source and royalty-free OSEK/VDX Kernel. This RTOS includes also RT-Druid, which is a development environment distributed as a set of Eclipse plugins.<br />Main Features:<br />? Hard Real-Time support with Fixed Priority Scheduling and Immediate Priority Ceiling;<br />? Support for Earliest Deadline First (EDF) and Resource Reservation Schedulers;<br />? 1-4 Kb Flash footprint, suitable for 8 to 32 bit microcontrollers;<br />? Support for multi-core platforms;<br />? Support for stack sharing among tasks;<br />? Easy configuration using RT-Druid with Eclipse plugins;<br />? Open-source: GPL2+Linking exception for the kernel, EPL for the Eclipse plugins.<img class="post-img" src="/uscsportsportal/source/Fresh Camp Logo for White Shirt.png" alt="Fresh Camp Logo for White Shirt" width="1000" height="650"></p>', '09307896'),
(11, 'Tennis Tryouts', '2015-11-23 08:46:41', '2015-11-23 08:46:41', 'tennis-tryouts', '<p>ERICKA ENTERPRISE</p>\r\n<p>It is an open-source and royalty-free OSEK/VDX Kernel. This RTOS includes also RT-Druid, which is a development environment distributed as a set of Eclipse plugins.<br />Main Features:<br />? Hard Real-Time support with Fixed Priority Scheduling and Immediate Priority Ceiling;<br />? Support for Earliest Deadline First (EDF) and Resource Reservation Schedulers;<br />? 1-4 Kb Flash footprint, suitable for 8 to 32 bit microcontrollers;<br />? Support for multi-core platforms;<br />? Support for stack sharing among tasks;<br />? Easy configuration using RT-Druid with Eclipse plugins;<br />? Open-source: GPL2+Linking exception for the kernel, EPL for the Eclipse plugins.</p>', '09307896'),
(12, 'USC Cheerdance Audtion', '2015-11-23 08:58:43', '2015-11-27 02:37:12', 'usc-cheerdance-audtion', '<p><img class="post-img" src="/uscsportsportal/source/samples.jpg" alt="samples" width="2048" height="1536"></p>\r\n<p [removed]>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using ''Content here, content here'', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as</p>', '09307896');
